def plot_hist(samples):
    samples_array = np.array(samples)
    samples_x = samples_array[:, 1]
    samples_y = samples_array[:, 2]
    print(samples_x.shape)
    print(samples_y.shape)

    fig, ax = plt.subplots()
    ax.scatter(samples_x, samples_y, marker='.', linewidths=1)
    ax.set_xlabel("CPU Frequency (MHz)")
    ax.set_ylabel("Processing Time (CPU Time) (ms)")
    fig.savefig("cpu_freq_vs_decode_time", dpi=300)
    plt.close(fig)


def plot_timeline(timestamps, values, outfile):
    fig, ax = plt.subplots()
    ax.plot(timestamps, values, marker='.', linewidth=1)
    ax.set_xlabel("Frame #")
    ax.set_ylabel("Processing Time (ms)")
    fig.savefig(outfile, dpi=300)
    plt.close(fig)


def analyze_timeline(samples):
    samples_array = np.array(samples)
    # samples_x = np.cumsum(samples_array[:, 0]) / 1000.
    samples_x = np.arange(len(samples_array[:, 0]))
    samples_y = samples_array[:, 0]

    plot_timeline(samples_x, samples_y, "jpg_decode_time.png")

    xx_timing = []
    xy_cpu_freq = []
    for yi, yy in enumerate(samples_y):
        if yy > 25.:
            xx_timing.append(samples_x[yi])
            xy_cpu_freq.append(samples[yi])
    print(xx_timing)
    print(xy_cpu_freq)


